女取湧水まで、一気に駈け上ります！
.
以前はすぐに襲歩が出ちゃいがちだった流も
ここ数年はすっかり落ち着いていましたが、
スピード女王のパコねぇさんとふたりだけの外乗ですから
飛ばしていきますよ😆
.
流の力強い駈歩に、流石の手ぶれ補正機能も追いつきません💦
ブレまくります〰️
.
スタッフさんが撮影をやめた辺りから
さらにスピードアップ⤴️⤴️します。
.
カーブで更に気合が入ります❗️
.
脚も鞭も使ってません！
馬なりです！
.
くぅーーっっ😆たまらんっ❗️
流の走りに惚れ惚れします❣️
.
パコの蹴り上げた小石が、私の顔に飛んできます😣ｲﾃｯ
この日、サングラスを忘れてしまった私は、
最後の方、飛んでくる小石を手でよけています！
.
スピード落として下がればよいのですが、
（良い子のみなさんは、そうしてください😌ケガのないように…😅）
ここまで来たらこのまま駈け抜けたい！
というか、もう止められないっ😆
.
前があまり見られてない状況でしたが、
流となら大丈夫❣️
…と流のことはそれだけ信頼しています😊
.
.
はぁーーっ❗️楽しかった😆
ケガなく無事、駈け抜けました❗️
流のおかげです😚💕🐴
.
ベテランチームになってきた流もパコも
まだまだ衰え知らずです✨✨
.
